import React from "react";
import { StyleSheet, View, Text } from "react-native";

const ItemCardapio = ({titulo,descricao,preco}) => {
  return (
    <View>
      <Text>{titulo}:{descricao}:{preco}</Text>
    </View>
  );
}

export default ItemCardapio;
